    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge outlines Refuge accomplishments for calendar year 1967.
    The report begins by summarizing the weather conditions, water conditions, habitat
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, vegetation control, and wildfires. Resource
    management is outlined; topics include haying. A progress report on field investigations
    and applied research is also provided.  The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
    and safety. Items of interest, photographs, and N-R forms are attached.",nt"license_title":
